package top.jacktu.page.bean;import java.io.Serializable;public class SouJob implements Serializable {	private static final long serialVersionUID = -496733989419248600L;	private int start;	private int end;	private int cityCode;	private String sort;	private int mainSalary;	private int maxSalary;	public int getCityCode() {		return this.cityCode;	}	public void setCityCode(int cityCode) {		this.cityCode = cityCode;	}	public String getSort() {		return this.sort;	}	public void setSort(String sort) {		this.sort = sort;	}	public int getMainSalary() {		return this.mainSalary;	}	public void setMainSalary(int mainSalary) {		this.mainSalary = mainSalary;	}	public int getMaxSalary() {		return this.maxSalary;	}	public void setMaxSalary(int maxSalary) {		this.maxSalary = maxSalary;	}	public static long getSerialversionuid() {		return -496733989419248600L;	}	public int getStart() {		return this.start;	}	public void setStart(int start) {		this.start = start;	}	public int getEnd() {		return this.end;	}	public void setEnd(int end) {		this.end = end;	}	public String toString() {		return "SouJob [start=" + this.start + ", end=" + this.end + ", cityCode=" + this.cityCode + ", sort="				+ this.sort + ", mainSalary=" + this.mainSalary + ", maxSalary=" + this.maxSalary + "]";	}}